import React, { Component } from 'react';
import PropTypes, { string } from 'prop-types';
class Header extends Component {
  render() {
    const { textHeader } = this.props;
    return (
      <header>
        <h1>
          { textHeader }
        </h1>
      </header>
    );
  }
}

Header.PropTypes = {
  textHeader: PropTypes.string,
}.isRequired;

export default Header;
